import store from '../path/to/store'; // Đường dẫn đến store của bạn
import { setScrollToElement } from '../path/to/gameSlice'; // Đường dẫn đến gameSlice của bạn

export const fetchData = async (url) => {
  const response = await fetch(url);
  if (!response.ok) {
    throw new Error('Network response was not ok');
  }
  return response.json();
};
